// src/pages/Welcome.js
import React from "react";
import { Link } from "react-router-dom";
import "../styles/Home.css"; // Import the Home page styles

const Welcome = () => {
  return (
    <div className="home-container">
      <div className="home-content">
        <h1 className="home-title">Welcome to Financial Assistant</h1>
        <p className="home-description">
          Easily track your expenses, set budgets, and get personalized insights to manage your finances better. Start your journey towards smarter money management today!
        </p>
        <Link to="/login" className="explore-btn">
          Get Started
        </Link>
      </div>
    </div>
  );
};

export default Welcome;
